const ExtraItem = ({ collapse }) => {

    console.log(collapse)

    return (

        <div id={"" + { collapse }} className="accordion-collapse collapse hide" aria-labelledby="headingOne" data-bs-parent="#accordionExample" >
            <div className="accordion-body d-flex">
                <div className="col-11">
                    <strong >This is the first item's accordion body.</strong>
                </div>
                <input className="form-check-input justify-content-end" type="radio" />


            </div>
        </div>



    )

}

export default ExtraItem;
